    false,nt"url": null,nt"notes": "The goal of this Habitat Rehabilitation
    and Enhancement Project (HREP) is to rehabilitate and enhance aquatic and related
    floodplain habitat. The purpose of this report is to present a detailed proposal
    for the rehabilitation and enhancement of the Fox Island Division project area.
    This Definite Project Report (DPR) provides planning, engineering, and sufficient
    construction details to allow final design and construction of the recommended plan
    to proceed. The USFWS serves as the Federal project sponsor. The Missouri  Department
    of Conservation (MDOC) and the Illinois Department of Natural Resources (ILDNR)
    serve as non-Federal project sponsors.",nt"license_title": "License Not Specified",nt"extras":
